/** @jsxImportSource theme-ui */
import {
  IonBackButton,
  IonButtons,
  IonCard,
  IonCardContent,
  IonCardHeader,
  IonCardSubtitle,
  IonCardTitle,
  IonCol,
  IonContent,
  IonDatetime,
  IonGrid,
  IonHeader,
  IonIcon,
  IonItem,
  IonLabel,
  IonMenuButton,
  IonPage,
  IonRow,
  IonTitle,
  IonToolbar,
} from "@ionic/react";
import { sad, sadOutline } from "ionicons/icons";
import React, { useState } from "react";

const Calendar: React.FC = () => {
  const [time, setTime] = useState(new Date().toISOString());
  const [bookings, setBookings] = useState([
    {
      bookingId: "",
      clientName: "",
      complexName: "",
      packageName: "",
      price: "",
      startTime: "",
      endTime: "",
    },
  ]);
  const updateTime = (currentTime: any) => {
    setTime(currentTime);
  };
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar color="primary">
          <IonButtons slot="start">
            <IonMenuButton />
          </IonButtons>
          <IonTitle>Calendar</IonTitle>
        </IonToolbar>
      </IonHeader>

      <IonContent fullscreen>
        <IonGrid>
          <IonRow>
            <IonCol>
              <IonItem>
                <IonLabel>Date</IonLabel>
                <IonDatetime
                  min="2021"
                  value={time}
                  onIonChange={(e) => updateTime(e.detail.value)}
                />
              </IonItem>
            </IonCol>
          </IonRow>
          {bookings[0].bookingId === "" &&
            bookings.map((booking) => {
              <IonRow id={booking.bookingId}>
                <IonCol>
                  <IonCard>
                    <IonCardHeader>
                      <IonCardTitle>{booking.clientName}</IonCardTitle>
                      <IonCardSubtitle>{booking.complexName}</IonCardSubtitle>
                    </IonCardHeader>
                    <IonCardContent>
                      {booking.packageName}
                      {booking.price}
                      {booking.startTime}
                      {booking.endTime}
                    </IonCardContent>
                  </IonCard>
                </IonCol>
              </IonRow>;
            })
          }
            {bookings[0].bookingId !== "" && <IonRow sx={styles.row}>
              <IonCol size='8'>
              <h2 sx={styles.heading}>No Bookings </h2>
              </IonCol>
              <IonCol>
                <IonIcon icon={sadOutline} sx={styles.heading.icon}/>
              </IonCol>
            </IonRow>
          }
        </IonGrid>
      </IonContent>
    </IonPage>
  );
};

export default Calendar;

const styles = {
  heading: {
    display: "flex",
    justifyContent: "center",
    color: "grey",
    pl: 5,
    pr: 0,

    icon:{
      pt: '10px',
      size: 40,
      color: "grey",
    },
  },
  row:{},
};
